from bisect import bisect, bisect_left

def sum_table(nums):
    so_far = []
    acc_table = {
        len(nums) - 1: []
    }
    # every element in the hash table will contain all of the number after that index, pretty terrible on time
    for j, n in reversed(list(enumerate(nums))):
        so_far.insert(bisect(so_far, n), n)
        acc_table[j - 1] = list(so_far)

    counts = 0
    for i, ni in enumerate(nums):
        j_vals = acc_table[i]
        idx = bisect_left(j_vals, ni / 2)
        counts += idx
    return counts

def find_impt_inversions(arr):

    inversion_counts = 0

    def merge_sort(arr):
        if len(arr) <= 1:
            return arr
        else:
            r = len(arr)
            m = (0 + r) // 2
            return merge(merge_sort(arr[:m]), merge_sort(arr[m:]))

    def merge(arr1, arr2):
        nonlocal inversion_counts
        # count the number of inversions
        carr1 = list(arr1)
        carr2 = [x*2 for x in arr2]
        ptr1, ptr2 = (0, 0)
        len_carr1, len_carr2 = len(carr1), len(carr2)
        while ptr1 < len_carr1 and ptr2 < len_carr2:
            n1, n2 = carr1[ptr1], carr2[ptr2]
            if n1 > n2:
                inversion_counts += len_carr1 - ptr1
                ptr2 += 1
            else:
                ptr1 += 1

        # do the actual merge O(n)
        # results = []
        # ptr1, ptr2 = (0, 0)
        # while ptr1 < len(arr1) or ptr2 < len(arr2):
        #     if ptr1 >= len(arr1):
        #         results.append(arr2[ptr2])
        #         ptr2 += 1
        #     elif ptr2 >= len(arr2):
        #         results.append(arr1[ptr1])
        #         ptr1 += 1
        #     else:
        #         n1, n2 = arr1[ptr1], arr2[ptr2]
        #         if n2 < n1:
        #             results.append(n2)
        #             ptr2 += 1
        #         else:
        #             results.append(n1)
        #             ptr1 += 1
        # return results
        return sorted(arr1 + arr2)

    merge_sort(arr)
    return inversion_counts



